import React from "react";

export function Note(props) {
    return (
        <div className="note">
            <h1> {props.title} </h1>
            <p> {props.content} </p>
            <button onClick={() => {
                props.onDel(props.id)
            }}
            > DELETE </button>
        </div>
    );
}
